        "name": "Donata Hopfen",
        "descriptionDe": "Donata Hopfen ist seit 1. Januar 2022 Vorsitzende der Geschäftsführung der DFL Deutsche Fußball Liga GmbH und Sprecherin des Präsidiums des DFL Deutsche Fußball Liga e.V.  Zuvor war Donata Hopfen, die im Jahr 2014 als „Medienfrau des Jahres“ in Deutschland ausgezeichnet wurde, als Managing Director und Partnerin bei BCG Digital Ventures, einem Unternehmen der Boston Consulting Group, tätig.  Nach einem Studium der Betriebswirtschaftslehre in Reutlingen und Madrid startete Donata Hopfen ihre Karriere bei der Unternehmensberatung Accenture. Es folgten Stationen bei Axel Springer, zuletzt als Vorsitzende der Verlagsgeschäftsführung der BILD-Gruppe. Anschließend war Donata Hopfen CEO bei Verimi, einem digitalen Gemeinschaftsprojekt führender deutscher Unternehmen. Parallel war sie Aufsichtsrat der Modern Times Group, Schweden, und Mitglied des Digitalbeirats der Postbank.  Donata Hopfen engagiert sich ehrenamtlich bei Save the Children Deutschland e.V. und Ein Herz für Kinder e.V.",
