        "name": "Matthew Ball",
        "descriptionDe": "\"Metaverse\" ist aktuell wohl DAS Buzzword der Stunde in der digitalen Welt – und wohl kaum jemand kennt sich mit diesem Thema so gut aus und wird so sehr damit assoziiert wie Matthew Ball. Seine Veröffentlichungen zum Thema werden von Mark Zuckerberg (Facebook), Reed Hastings (Netflix), Tim Sweeney (Epic Games) und Brian Armstrong (Coinbase) empfohlen. Von Haus aus ist Ball Investor. Er ist zum einen Managing Partner beim Unternehmen EpyllionCo, das sowohl einen Early Stage Fonds betreibt als Konzerne bei ihren Investments berät, zum anderen Partner beim milliardenschweren Gaming-Fond Makers Fund. Darüber ist er auch als Berater beim Private-Equity-Riesen KKR und Mitgründer von Ball Metaverse Research Partners tätig, dem Unternehmen hinter dem weltweit ersten Metaverse ETF. In der Vergangenheit war der Kanadier in der Entertainment-Branche tätig, zunächst als Leiter des Business Developments von The Chernin Group, hinter der der ehemalige Newscor-COO Peter Chernin steht, dann als Head of Strategy von Amazon Studios.",
        "descriptionEn": "As the term and concept of the metaverse have burst into public consciousness just in the last year, no voice has been more prominent, influential, and praised than Matthew Ball and his widely read Metaverse Primer. His publications on the topic have been read and recommended by Mark Zuckerberg (Facebook), Reed Hastings (Netflix), Tim Sweeney (Epic Games) and Brian Armstrong (Coinbase). Matthew Ball is the Managing Partner of EpyllionCo, which operates an early stage venture fund, as well as a corporate and venture advisory arm. In addition, Ball is a Venture Partner at the famed gaming investment fund Makers Fund, Industry Advisor to storied private equity giant KKR, and a co-founder of Ball Metaverse Research Partners, which creates and maintains the index behind the world’s first Metaverse ETF, the Roundhill Ball Metaverse ETF. From 2016–2018, Ball served as the global Head of Strategy for Amazon Studios, and prior to that was a Director at The Chernin Group’s Otter Media, a digital media investment company founded by long-time Newscorp COO and 20th Century Fox CEO Peter Chernin.",
