        "name": "Rutger Bregman",
        "descriptionDe": "Rutger Bregman hat fünf Bücher über Geschichte, Philosophie und Wirtschaft verfasst, die in mehr als 40 Sprachen übersetzt worden sind. Seine Werke waren auf den Bestseller-Listen der New York Times und des Spiegels vertreten. Der 33-Jährige setzt sich vor allem mit Themen wie der Zukunft der Arbeit und dem bedingungslosen Grundeinkommen auseinander. Besondere Aufmerksamkeit erregte Bregman im Jahr 2019 beim Weltwirtschaftsforum in Davos, als er in einer Paneldiskussion kritisierte, dass dort zu viel über Philanthropie und zu wenig über Steuervermeidung und eine höhere Besteuerung Wohlhabender gesprochen werde. Ein Zusammenschnitt seines Statements sammelte bei Twitter knapp elf Millionen Views an. Ein weiterer Mitschnitt eines einen Monat später aufgezeichneten und nie offiziell ausgestrahlten Interviews mit dem konservativen Fox-News-Moderator Tucker Carlson, in dem Bregman Carlson ebenfalls vorwarf zu wenig über eine höhere Besteuerung zu sprechen, ist auf Twitter bislang fast 15 Millionen Mal abgerufen worden.",
        "descriptionEn": "is a historian and author. He has published five books on history, philosophy, and economics. His books Humankind (2020) and Utopia for Realists (2017) were both New York Times Bestsellers and have been translated in more than 40 languages. Bregman has twice been nominated for the prestigious European Press Prize for his work at The Correspondent. He lives in Holland.",
