        "name": "Kara Swisher",
        "descriptionDe": "Kara Swisher galt schon 2003 als einflussreichste Tech-Journalistin der USA – damals arbeitete sie noch beim Wall Street Journal. Und schon früh sitzt sie mit den Großen der Branche zusammen und stellt die wirklich wichtigen Fragen. In ihrer langen Karriere hat Swisher Interviews mit Bill Gates, Steve Jobs, Elon Musk und all den anderen geführt. Heute ist sie auch für ihren Podcast \"Recode Decode\" (die Tech-Seite Recode hat sie mit gegründet) bekannt und haut anscheinend nebenbei gemeinsam mit Scott Galloway noch den Pivot-Podcast raus – absolute Hörpflicht für Leute im Digital-Business. Es gibt wohl kaum eine bessere Erklärerin für die Tech-Welt als Kara.",
        "descriptionEn": "As far back as 2003, Kara Swisher has been considered one of the savviest and influential tech journalists in the US of A. Starting out at the Wall Street Journal, Swisher met regularly with the biggest names in the industry and asked the critical, pressing questions of the day. Over the course of her impressive career, she has interviewed Bill Gates, Steve Jobs, Elon Musk and other such absolute a-listers. Currently, she has made a name for herself as the host of \"Recode Decode\" (she co-founded tech site Recode) and still manages to find the time to co-host the world’s leading business podcast Pivot alongside with Scott Galloway. You’d be hard pressed to find anyone more qualified than Swisher to break down tech anywhere.",
