        "name": "Scott Galloway",
        "descriptionDe": "Scott Galloway ist einer der cleversten Vordenker im digitalen Marketing. Er hat den gescheiterten Börsengang von Wework ebenso vorhergesehen wie die Übernahme von Wholefoods durch Amazon. Scott ist Professor für Marketing an der NYU Stern School of Business, hat in seinem Leben mehrere Unternehmen gegründet und verkauft (zuletzt an den Marktforscher Gartner) und ist gemeinsam mit der US-Tech-Journalistin Kara Swisher Gastgeber des Podcasts \"Pivot\", einem der weltweit erfolgreichsten Business Podcasts.",
        "descriptionEn": "When it comes to digital marketing, Scott Galloway has a knack for seeing what's next before the market does. Cases in point: He accurately nailed WeWork's unsuccessful IPO and Amazon's successful takeover of WholeFoods. In addition to being a digital marketing clairvoyant, Galloway is a professor of marketing at the NYU Stern School of Business, has founded and sold numerous success businesses, the most recent of which he sold to market researcher Gartner. On top of all of that, he co-hosts one of the most popular business podcasts on the planet in Pivot together with US tech journalist Kara Swisher.",
