        "name": "Ashton Kutcher",
        "descriptionDe": "Er ist seit mehr als 20 Jahren eine feste Größe der Hollywood-Welt – und gleichzeitig sehr aktiver Investor in Tech-Unternehmen. Seit über zehn Jahren investiert er bereits in verschiedene Unternehmen. Zuerst mit A-Grade Investments, heute über seinen VC Sound Ventures. Zu Kutchers Portfolio gehören Unternehmen wie Airbnb, Uber, Robinhood, Airtable und viele weitere. Derzeit konzentriert er sich gemeinsam mit seiner Frau Mila Kunis auf Hilfe für die Ukraine. Gemeinsam haben sie bereits 35 Millionen US-Dollar gesammelt.",
        "descriptionEn": "Ashton Kutcher is an actor, investor, entrepreneur, producer and philanthropist. Kutcher has been named one of TIME magazine’s “100 Most Influential People in the World,” as well as being honored by Vanity Fair ‘s “New Establishment List,” which identifies the top 50 of an innovative new breed of buccaneering visionaries, engineering prodigies and entrepreneurs. Twice, Kutcher was named one of Forbes magazine’s “World’s Most Powerful Celebrities,” as well as one of Fast Company magazine’s “Most Creative People.” Kutcher has been investing in technology for over a decade, both as an angel investor and a founding partner of A-Grade Investments and Sound Ventures. His fund portfolio includes Airbnb, Uber, Flexport, Brex, Robinhood, GitLab, Airtable and Affirm among others.",
