        "name": "Pedro Pina",
        "descriptionDe": "Pedro Pina kam 2013 als Global Client Partner zu Google, wo er ein weltweites Team leitete, das sich intensiv mit der Zusammenarbeit mit Europas größten Werbeunternehmen wie Unilever, L’Oreal, Nestlé, LVMH, VW, BMW und vielen anderen widmete. Seit Juli 2021 leitet er den Betrieb von YouTube in Europa, dem Nahen Osten und Afrika. Pedro leitet für Google die LGBTQ+ Efforts in der gesamten Region und ist außerdem Mitglied des DEI Council in EMEA. Pedro ist Vorstandsmitglied von OutRight Action International, beratendes Mitglied des Outvertising Council in Großbritannien und Mitglied des Corporate Advisory Board des Victoria & Albert Museum of Art.",
        "descriptionEn": "Pedro Pina joined Google in 2013 as Global Client Partner overseeing a team spread around the world dedicated to lead Google’s deep engagement with Europe’s biggest giants in advertising like Unilever, L’Oreal, Nestle, LVMH, VW or BMW among many others. From July 2021 he lead the operation of YouTube in Europe, Middle East and Africa. Pedro also leads for Google the LGBTQ+ chapter across the region and he’s also a member of the EMEA’s DEI Council. Pedro is a Board Member of OutRight Action International, an Advisory Member for the Outvertising Council in the UK and a member of the Corporate Advisory Board of the Victoria & Albert Museum of Art. ",
