        "name": "Saygin Yalcin",
        "descriptionDe": "Saygin Yalcin hat das geschafft, wovon viele träumen: aus einfachen Verhältnissen im Bremer Plattenbau zum Unternehmer und Selfmade-Millionär. Mit Mitte 30 kann Saygin auf eine unglaubliche Erfolgsgeschichte zurückblicken. Vor mehr als 10 Jahren ist er mit nur einem Rucksack und 4.000 Euro in seiner Tasche nach Dubai gereist, um seine Geschäftsidee in die Realität umzusetzen. Nach jahrelanger harter Arbeit, unglaublichem Fleiß, wenig Schlaf und viel Willensstärke gilt Saygin heute als einer der erfolgreichsten Unternehmer im Nahen Osten.  Sein Aufstieg beginnt mit seinem ersten Unternehmen Sukar.com, dem ersten und größten Fashion-Online-Shop im Nahen Osten, welcher mit Souq.com fusionierte und Saygin zum Partner, President und Vice-President bei Souq.com und bei der Jabbar Internet Group machte. Das E-Commerce-Unternehmen mit mehr als 4.000 Mitarbeitern wurde später für eine Rekordsumme von Amazon.com erworben. Bis heute gilt dies als die bisher größte Akquisition von Amazon außerhalb der USA. Als Gründer und Geschäftsführer von SellAnyCar.com, dem ersten und größten Autokaufdienst im Nahen Osten, hat Saygin hierauf das wachstumsstärkste Unternehmen der Region gegründet. Laut National Magazine galt SellAnyCar.com als eines der wenigen Unternehmen, das bereits zwei Jahre nach der Gründung das Potenzial hatte, die magische Grenze von einer Milliarde US-Dollar zu durchbrechen.",
        "descriptionEn": "Saygin Yalcin has pulled off what other people can only dream of: going from modest surroundings to a self-made millionaire. Only in his mid-30s, Saygin can already look back on an incredible success story. Over a decade ago, he travelled to Dubai with a bag, 4000k in cash and dreams of turning his business idea into a reality. After years of hardwork, dedication and little sleep, Saygin is considered one of the most-successful entrepreneurs in the Middle East.",
