        "name": "Kağan Sümer",
        "descriptionDe": "Kağan Sümer ist CEO und Gründer von Gorillas, dem führenden europäischen Instant-On-Demand-Lieferservice. In den frühen Jahren seiner Beratungskarriere und nach einer lebensverändernden Fahrradtour stellte sich Kağan eine Welt vor, in der Lebensmitteleinkäufe radikal schneller und viel bequemer sein würden, und so wurde Gorillas im Mai 2020 geboren. In nur zwei Jahren haben Kağan und sein Team die Lebensmittelindustrie im Sturm erobert, weltweit mehr als 15.000 Mitarbeiter eingestellt und in 60 Städten in 9 Ländern expandiert.",
        "descriptionEn": "Kağan Sümer is the CEO and Founder of Gorillas, the leading European instant on-demand delivery service. It was in the early years of a career in consulting and after life changing bike ride, that Kağan envisioned a world where grocery shopping would be radically faster and far more convenient, and so, Gorillas was born in May 2020. In just two years, Kağan and his team have taken the grocery industry by storm, hiring more than 15,000 employees globally and expanding in 60 cities across 9 countries.",
