        "name": "Shirin David",
        "descriptionDe": "Als Barbara Shirin Davidavicius alias Shirin David Anfang 2019 gerade ihre ersten beiden Rap-Singles auf den Markt gebracht hatte, war sie für die meisten trotzdem noch die von Youtube und Instagram bekannte Creatorin aus Hamburg. Das dürfte sich seitdem auf jeden Fall geändert haben. Denn Shirin hat nicht nur einen Imagewandel zur selbstbewussten und unabhängigen Rapperin vollzogen, sie steht auch stellvertretend für die boomende Creator Economy wie kaum eine andere Künstlerin (Stichwort: DirTea). Ihr Debütalbum „SUPERSIZE” knackte als erste Platte einer deutschen Rapperin überhaupt den ersten Platz der Charts. Das Folgealbum „BITCHES BRAUCHEN RAP” chartete auf dem dritten Platz und holte weitere Rekorde: Es ist das erste deutsche female Rap-Album in der Geschichte der Deutschen Charts, auf dem drei Nummer-Eins-Singles vertreten sind. „BITCHES BRAUCHEN RAP” gelang  außerdem der erfolgreichste Streamingstart am Release-Wochenende einer Künstlerin in Deutschland. Insgesamt stand Shirin David in ihrer bisherigen Karriere mit fünf Solo-Singles auf Platz 1 der Charts - keiner anderen deutschen Rapperin ist es jemals zuvor gelungen. Ihr eigenes Parfum verkauft sie unter anderem über die Parfümerie-Kette Douglas.",
